import { Profile } from './profileApp/profile';
import user from '../data/user.json';
import { Statistics } from './statisticsApp/data';

export const App = () => {
  return (
    <div>
      <Profile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    </div>
  );
};
